import React,{useContext} from 'react'
import {GlobalContext} from '../context/context'
export default function Shopitem() {
    const {shopingcart} = useContext(GlobalContext)
    return (
        <div>
            {shopingcart.map((item)=>(<img src={item.image} />))}
        </div>
    )
}
